import React, {Component} from 'react';

import { Button } from 'react-bootstrap';

class SignUp extends Component{
    constructor(){
      super();
      this.state={
        myInfo : {
            fName:'',
            lName:'',
            e_mail:'',
            password:'',
            cPassword:'',
            country:'',
            city:'',
            Contact_Number:'',
            Passport_Number:'',
            NIC_Number:''

        },
        fields:[],
        error:'this is error'
      }
    }

     componentDidMount(){
         console.log("Login Data is here ",this.props.location.data)
    }
    successMessage(event){

        this.state.fields.push(this.state.myInfo);
        this.setState({
            fields : this.state.fields
        })
        console.log('hi there',this.state.myInfo )
        event.preventDefault();
    }

    inputChange(changeValue,event){

        this.state.myInfo[changeValue] = event.target.value;
        console.log('event', event.target.value);
    this.setState({
            myInfo : this.state.myInfo
        });

    }


render(){
    return(


<div>
    <form>
    <TextField
                    name="FName"
                    hintText="First Name"
                    floatingLabelText="First Name"
                    value={this.state.myInfo.fName}
                    onChange={e => this.change(e)}
                    floatingLabelFixed
                      />
                    <br></br>



                    <TextField
                    name="password"
                    hintText="Password"
                    floatingLabelText="password"
                    value={this.state.myInfo.password}
                    onChange={e => this.change(e)}
                    floatingLabelFixed
                      />
                    <br></br>




<Button bsStyle="primary" onClick={this.successMessage.bind(this)}><b>Sign Up</b></Button>

    </form>
</div>

    )

}

}
export default SignUp
